import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Home from './pages/Home';
import GroupStage from './pages/GroupStage';
import KnockoutStage from './pages/KnockoutStage';

function App() {
    return (
        <Router>
            <nav style={{ padding: "20px" }}>
                <Link to="/" style={{ margin: "10px" }}>Accueil</Link>
                <Link to="/group-stage" style={{ margin: "10px" }}>Phases de groupes</Link>
                <Link to="/knockout-stage" style={{ margin: "10px" }}>Ã‰limination directe</Link>
            </nav>
            <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/group-stage" element={<GroupStage />} />
                <Route path="/knockout-stage" element={<KnockoutStage />} />
            </Routes>
        </Router>
    );
}

export default App;
